import React, {useEffect} from "react";
import * as ProductActions from '../../../../redux/product/product.action';
import * as ProductReducer from '../../../../redux/product/product.reducer';
import {useDispatch, useSelector} from "react-redux";

interface IProps{

}
interface IState{
    products : ProductReducer.ProductState
}

let MensCollection : React.FC<IProps> = () => {
    let dispatch = useDispatch();
    useEffect(() =>{
        dispatch(ProductActions.getMensProducts())
    }, [])

    let products : ProductReducer.ProductState = useSelector((state:IState) => {
        return state.products;
    })
    return(
        <React.Fragment>
            <section className="mt-3">
                <div className="container">
                    <div className="row">
                        <div className="col-md-3">
                            {
                                products.products.map(product => {
                                    return(
                                        <React.Fragment>
                                            <div key={product._id} className="card">
                                                <img src={product.image} className="img-fluid" alt=""/>
                                            </div>
                                        </React.Fragment>
                                    )
                                })
                            }
                        </div>
                    </div>
                </div>
            </section>
        </React.Fragment>
    )
}

export default MensCollection;
